Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "用于受害国在其港口拘押敌国船舶以实施报复。对违反国际法国家实施经济、外交和其他制裁手段，用\"制裁\"或更具体的叙词，如\"武器禁运\"。", language_id: (Language.find_by name: 'zh').id])
